import { Route } from 'react-router-dom';
import { Routes } from 'react-router-dom';
import './App.css';
import About from './Components/About';


function App() {
  return (
    <div className="App">


      <Routes>
        <Route path='/' element={<About/>}  ></Route>
      </Routes>

    </div>
  );
}

export default App;
